import React, { useEffect } from "react";
import "./App.css";
import uniqid from "uniqid";
import data from "./components/data";

function App() {
  const [characters, setCharacters] = React.useState(data.data);
  const randomNumberArray = [...Array(10)]
    .fill()
    .map((x) => Math.ceil(Math.random() * 75) + 1);
  const mappedCharacters = randomNumberArray.map((num) => {
    return <img src={characters[num].character.images.jpg.image_url} />;
  });

  return (
    <div>
      <h1>{mappedCharacters}</h1>
    </div>
  );
}

export default App;
